import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={{ 
      display: 'flex', 
      flexDirection: 'column',
      alignItems: 'center', 
      justifyContent: 'center',
      height: '100vh', 
      backgroundColor: '#f9f9f9',
      fontFamily: 'Arial, sans-serif'
    }}>
      <h1 style={{ fontSize: '2.5rem', marginBottom: '0.2rem' }}>üêæ Walky Loving Dogs</h1>
      <p style={{ fontSize: '1.1rem', color: '#555', marginBottom: '2rem' }}>
        Aplica√ß√£o de Creche para Cachorros
      </p>
      
      <div style={{ display: 'flex', gap: '1rem', flexWrap: 'wrap' }}>
        <Link to="/pets" style={buttonStyle('blue')}>Ver Pets</Link>
        <Link to="/admins" style={buttonStyle('teal')}>Ver Admins</Link>
        <Link to="/donos" style={buttonStyle('indigo')}>Ver Donos</Link>
        <Link to="/tutores" style={buttonStyle('green')}>Ver Tutores</Link>
      </div>
    </div>
  );
};

const buttonStyle = (color) => ({
  padding: '10px 20px',
  backgroundColor: colorMap[color],
  color: '#fff',
  border: 'none',
  borderRadius: '8px',
  textDecoration: 'none',
  fontSize: '1rem',
  fontWeight: 'bold',
  boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
  transition: 'background-color 0.3s',
});

const colorMap = {
  blue: '#007bff',
  teal: '#17a2b8',
  indigo: '#6610f2',
  green: '#28a745'
};

export default Home;
